    Game Features:
    ~~~~~~~~~~~~~~
    RHEM 2 is an intricate pure-puzzle first person adventure game, and
    the sequel to the popular RHEM. Made for PC and Mac, RHEM 2 rejoins
    Zetais and Kales as they now explore a hidden city far beneath the
    earth?s surface.

    Like its predecessor, RHEM 2 features non-linear gameplay, non-violent
    story, and mind-bending puzzles. The game is set as a direct sequel in
    story and gameplay to RHEM. Having discovered entry to a hidden
    underground city, you will venture ever deeper as you explore a maze
    of clandestine caves, secret rooms, and intricate walkways, tunnels
    and water systems. As you marvel at beautifully detailed environments
    and solve clever puzzles, you must search for an enigmatic artifact
    that must be found and photographed before you return to the surface.


